import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogs-items">
        <div className="item">Vadick</div>
        <div className="item">Alina</div>
        <div className="item">Chesterock</div>
        <div className="item">Puppy</div>
        <div className="item">Another puppy</div>
        <div className="item">Cherepashka</div>
        <div className="item">Another cat</div>
      </div>
    </div>
  );
};

export default Dialogs;
